import React from 'react';
import { Card, Container } from 'react-bootstrap';

const Main = () => {
    const dummy = {
        lastBook: {
            title: '위대한 게츠비',
            image: '',
        },
    };

    return (
        <Container>
            <div className='row'>
                <div className='col-6'>
                    <Card>
                        <Card.Body>
                            <h3>마지막으로 읽은 책</h3>
                        </Card.Body>
                    </Card>
                </div>

                <div className='col-6'>
                    <Card>
                        <Card.Body>
                            <h3>이번달 통계</h3>
                        </Card.Body>
                    </Card>
                </div>
            </div>
        </Container>
    );
};

export default Main;
